export default function Note(props){



function handleClick() {
    props.onDelete(props.id);
  }
  
    
    
return(
    <div className="note"> 
    
    <h1>{props.titulo_nota}</h1>
    <p>{props.descricao_nota}</p>
    <button onClick={handleClick}>Deletar</button>

    </div> 
);

}
